import proptypes from 'prop-types';


class todolist extends React.Component {
  render() {
    return (
      <div>
        <h3>{this.props.todo.title}</h3>
      </div>
      
    );
  }
}

todolist.proptypes= {
    todo: proptypes.object.isRequired
  }

export default todolist;
